*  Testudines (tortues) Les reptiles (du latin, rampant) sont des animaux terrestres à température variable (ectothermes) et au corps souvent allongé et recouvert d'écailles. Ce groupe, parfois considéré comme un taxon dénommé Reptilia, inclut aussi des animaux comme les dinosaures, les ptérosaures, les ichtyosaures, les plésiosaures et les pliosaures. Avec l'essor de la cladistique, certains scientifiques ont commencé à considérer que ce regroupement n'était pas pertinent. En effet les reptiles ne sont pas un groupe holophylétique incluant tous les descendants d'un ancêtre commun exclusif. Ils forment un regroupement paraphylétique car les mammifères et les oiseaux qui dérivent d'un ancêtre reptilien en sont exclus. Bien que tous ectothermes et recouverts d'écailles, les reptiles actuels, crocodiliens, tortues, rhynchocéphales et squamates appartiennent à des lignées parfois moins proches les unes des autres qu'avec d'autres lignées non reptiliennes comme les oiseaux. Les crocodiliens par exemple sont bien plus proches des oiseaux que des lézards ou des tortues. De plus, certains groupes considérés comme des reptiles possèdent des caractéristiques que n'ont pas les reptiles actuels. Les ichtyosaures, se sont révélés avoir été vivipares ; d'autres tels les ptérosaures étaient velus ; d'autres encore, les reptiles mammaliens ont donné naissance aux mammifères, et enfin les dinosaures ont révélé parmi eux des formes à température constante (homéothermes) et certains, des théropodes, ont donné naissance aux oiseaux. Ce regroupement a été abandonné par les scientifiques cladistes ainsi que dans l'enseignement primaire et secondaire français, mais il est encore largement utilisé dans le langage courant et est toujours formellement reconnu comme valide par les scientifiques évolutionnistes. La classe Reptilia comprend quatre ordres d'espèces contemporaines : 
*  les crocodiliens : 0 espèces de crocodiles, gavials, caïmans et alligators ; 
*  les rhynchocéphales : 0 espèce de sphénodons ; 
*  les squamates : environ 0 espèces de lézards (au sens large), serpents et amphisbènes (« lézard-ver ») ; 
*  les tortues : environ 0 espèces. L'étude de ces animaux forme une des deux branches de l'herpétologie, l'autre étant l'étude des amphibiens, anciennement rapprochés des reptiles. Les premiers animaux à pouvoir être placés dans cette classe sont apparus sur Terre dès le Carbonifère, en même temps que les amniotes. Premiers vertébrés à pouvoir coloniser le milieu terrestre, ils se diversifient rapidement en de nombreuses espèces. Les reptiles sont aujourd'hui bien représentés avec plus de 9 000 espèces répertoriées en 2011, localisées surtout à proximité des tropiques, mais la vision traditionnelle selon laquelle le Mésozoïque aurait été un « âge des reptiles » suivi par un « âge des mammifères » est abandonnée, et l'on considère aujourd'hui qu'un « âge des dinosaures et des mammifères » a commencé au Trias et se poursuit de nos jours (puisque les oiseaux sont des dinosaures), tandis que le véritable « âge des reptiles » se place avant cela, au Permien, pour s'estomper au Trias. Les reptiles ont depuis toujours fasciné les hommes. Ils inquiètent, font souvent peur et sont l'objet d'une symbolique complexe. Omniprésents dans les mythologies du monde entier, ils ont inspiré l'imagination des hommes, servant par exemple de modèles aux dragons. Ces dernières années, l'élevage de reptiles se développe dans le monde, pour fournir le marché de la viande dans certains pays consommateurs, mais surtout les marchés de la maroquinerie de luxe, qui utilise leurs peaux, et celui des nouveaux animaux de compagnie. Toutefois, le braconnage est également très répandu, et met en danger de nombreuses espèces, malgré les tentatives de régulation du commerce d'animaux sauvages menées au niveau international. La pollution et la disparition des habitats des reptiles sont les autres principaux dangers auxquels ils sont exposés.
